window.bookSummaryJSON = "<p><b><i>They're marrying me off to a monster.</i></b></p> <p>I knew the day would come. I just didn't think it would be so soon.</p> <p>I'm betrothed.</p> <p>I'd always imagined my future husband would be some minor lord who'd value me only because I would bear him heirs.</p> <p>I never thought Father would go to the capital and seek an audience with Emperor Valdon Duthriss himself. What unholy deal did he make that I, a mere baron's daughter, ended up betrothed to <i>that</i> man?</p> <p>The son.</p> <p>Corvan Duthriss.</p> <p>War hero. Commander. Fallen.</p> <p>They say the war in the Northlands changed him. Alongside his armies, he fought dark magic in the mountains. It transformed him. They say he's changed beyond recognition. That he refuses to show his face in the capital because he can no longer walk under the sun.</p> <p>He's also the emperor's firstborn.</p> <p>The once-heir to the Rahavan Empire.</p> <p>And it's unheard of for a baron's daughter like me to marry into the powerful Duthriss family.</p> <p>They're shipping me off before winter's end. To the cold, forbidding North. To the Cursed Archduke of Tyron.</p> <p>I'll go. I have no choice. There's too much at stake.</p> <p>I can only pray that Corvan Duthriss isn't as terrible as the rumors make him out to be.</p>"; 
